import style from "./Popular.module.scss";
import { Container } from "../Container/Container";
export const Popular = () => {
  return <div className={style.popular}>
    <Container>
      <div className={style.container_popular}>
        <div className="popular__title">
            <h2></h2>
        </div>
      </div>
    </Container>
  </div>;
};
